import css from "./TitleTextPicButton.css";

const TitleTextPicButton = props => (
  <div className={css.container}>
    <img className={css.image} src="https://i1.sndcdn.com/artworks-000478704579-o7peaj-t500x500.jpg" />
    <div className={css.rightHalfContainer}>
        <div className={css.tagline}></div>
        <div className={css.text}></div>
    </div>
  </div>
);

export default TitleTextPicButton;
